import './App.css';
import {Router, Link, Switch} from 'react-router-dom';
import Home from './Home'
import CreateProp from './CreateProp'
import EditProp from './EditProp'

function App() {
  return (

    <div>
      <nav className="navbar bg-dark navbar-light">
        <div class="navitem">Home</div>
      </nav>

      <Switch>

      <Router>
        <Link exact path="/" component={Home}></Link>
        <Link path="/creteProp" component={CreateProp}></Link>
        <Link path="/editProp" component={EditProp}></Link>
      </Router>
      </Switch>

    </div>
  );
}

export default App;
